define( [
	'../../../../bower_components/underscore/underscore',
	'backbone',
	'config'
], function( _,Backbone, Config ){
    var InstructorReviewModel = Backbone.Model.extend( {
			url: function() {
				return Config.apiURL + '/instructors/' + this.id;
			},
			defaults: function() {
				return {
					id: '',
					author: '',
					reviewBody: '',
					starRating: 0,
					dateTime: ''
				};
			}
    } );
    return InstructorReviewModel;
});
